&quot;It might be a cold day in Budapest but things definitely start to heat up as the guys are given a tour of the city by the very lovely duo of Aleska Diamond and Angelika Black. In an attempt to allude the cameras, the foursome breaks off into couples, but still, Christoph manages to track down each pair, reminding them of the trip's cardinal rule: they can fuck all they want...so long as he's there to film!&quot;
